import { useState, useRef } from "react"

export function Language() {
  return (
    <>
      <div className="custom-select-wrapper"></div>
      <div className="custom-select">
        <div className="select-trigger select-field w-select">
          <span>Select Language</span>
          <div className="arrow"></div>
        </div>
        <div className="custom-options">
          <label className="custom-option">
            <input type="checkbox" value="option1" /> Tamil
          </label>
          <label className="custom-option">
            <input type="checkbox" value="option2" /> Telugu
          </label>
          <label className="custom-option">
            <input type="checkbox" value="option3" /> Kannadam
          </label>
          <label className="custom-option">
            <input type="checkbox" value="option4" /> Malayalam
          </label>
          <label className="custom-option">
            <input type="checkbox" value="option5" /> Hindi
          </label>
          <label className="custom-option">
            <input type="checkbox" value="option6" /> English
          </label>
          <label className="custom-option">
            <input type="checkbox" value="option7" /> Others
          </label>
        </div>
      </div>
    </>

  )
}
export function Language_Comp() {
  const [selectedOptions, setSelectedOptions] = useState([]);
  const [isOpen, setIsOpen] = useState(false);
  const options = ['Tamil', 'Telugu', 'Kannadam', 'Malayalam','Hindi','English','Others'];
  const dropdownRef = useRef(null);

  const handleCheckboxChange = (event) => {
    const { value, checked } = event.target;
    setSelectedOptions(prev =>
      checked ? [...prev, value] : prev.filter(option => option !== value)
    );
  };

  const toggleDropdown = () => {
    setIsOpen(!isOpen);
  };
  return (
    <>
      <div className="custom-select-wrapper">
      <div className="custom-select" ref={dropdownRef}>
        <div className="select-trigger select-field w-select" onClick={toggleDropdown}>Language ▼
        </div>
        {isOpen && (
          <div className="custom-option">
            {options.map((option, index) => (
              <label key={index} className="custom-option">
                <input
                  type="checkbox"
                  value={option}
                  checked={selectedOptions.includes(option)}
                  onChange={handleCheckboxChange}
                />
                {option}
              </label>
            ))}
          </div>
        )}
      </div>
      </div>
    </>
  )
}
export function Gender() {
  return (
    <select id="Gender" name="Gender" data-name="Gender" className="select-field w-select">
      <option value="">Select Gender</option>
      <option value="First">Male</option>
      <option value="Second">Female</option>
      <option value="Third">Others</option>
    </select>
  )
}

export function Gender_Comp() {
  const list = [
    { value: '', label: 'Select Gender' },
    { value: 'First', label: 'Male' },
    { value: 'Second', label: 'Female' },
    { value: 'Third', label: 'Others' }
  ]
  return (
    <select id="Gender" name="Gender" data-name="Gender" className="select-field w-select">
      {
        list.map(option => (
          <option value={option.value}>{option.label}</option>
        ))
      }
    </select>
  )
}

export function Age() {
  return (
    <select id="AGE" name="AGE" data-name="AGE" className="select-field w-select">
      <option value="5 – 10">Select Age</option>
      <option value="First">5 – 10</option>
      <option value="Second">10 - 15</option>
      <option value="Third">15 - 20</option>
      <option value="Another option">25 - 30</option>
      <option value="Another option">30 - 35</option>
      <option value="Another option">35 - 40</option>
      <option value="Another option">40 - 45</option>
      <option value="Another option">45 - 50</option>
    </select>
  )
}
export function Age_comp() {
  const options = [
    { value: 'Age', label: 'Age' },
    { value: 'First', label: '5 - 10' },
    { value: 'Second', label: '10 - 15' },
    { value: 'Third', label: '15 - 20' },
    { value: 'Another option', label: '25 - 30' },
    { value: 'Another option', label: '30 - 35' },
    { value: 'Another option', label: '35 - 40' },
    { value: 'Another option', label: '40 - 45' },
    { value: 'Another option', label: '45 - 50' }
  ]
  return (
    <>
      <select id="AGE" name="AGE" data-name="AGE" className="select-field w-select">
        {
          options.map(list => (
            <option value={list.value}>{list.label}</option>
          ))
        }
      </select>
    </>
  )
}
export function Slang() {
  return (
    <select id="Slang" name="Slang" data-name="Slang" class="select-field w-select">
      <option value="">Select Slang</option>
      <option value="First">Madurai</option>
      <option value="Second">Chennai</option>
      <option value="Third">Coimbatore</option>
      <option value="Another option">Nagarkovil</option>
      <option value="Another option">General</option>
    </select>
  )
}
export function Slang_Comp() {
  const list = [
    { value: '', label: 'Select Slang' },
    { value: 'First', label: 'Madurai' },
    { value: 'Second', label: 'Chennai' },
